import React,{useContext,useEffect,useNavigate, useState} from 'react'
import Notecontext from "../context/notes/NotesContext";
import Resultitems from './Resultitems';

export default function Results() {
    const a = useContext(Notecontext);
    const navigate=useNavigate;
    const [winner,setwinner]=useState({voteCount:0,name:""});

    useEffect(() => {
        if (localStorage.getItem("token1")) {
          a.getNotes();
          for (let note of a.notes){
            console.log(note);
            if(note.voteCount>winner.voteCount){
                setwinner(note.voteCount,note.name);
            }
        }
        } else {
          navigate("/");
        }
        // eslint-disable-next-line
      }, []);
    
    
  return (
    <div className="container text-center" style={{height:"500px",display:"flex",justifyContent:"center",alignItems:"center"}}>
        <div className="row row-cols-auto">
            {a.notes.map((note) => {
                return (
                    <Resultitems
                        key={note._id}
                        note={note}
                        name={note.name}
                        party={note.party}
                        voteCount={note.voteCount}
                    />
                );
            })}
        </div>
        <div>
            Reasult::The winner is -{winner.name}{winner.voteCount}
        </div>
    </div>
  )
}
